import './App.css';
import MainSection from './components/section1/mainSection';
import ClickSpark from './components/spark/spark';
import DotGrid from './components/Squares/squares';
import Squares from '.';


function App() {
  return (

    <ClickSpark
      sparkColor='#fff'
      sparkSize={30}
      sparkRadius={60}
      sparkCount={5}
      duration={700}
    >
      <Squares
        speed={0.5}
        squareSize={40}
        direction='diagonal' // up, down, left, right, diagonal
        borderColor='#fff'
        hoverFillColor='#222'
      />
      <div className='w-full flex flex-col items-center gap-20 max-w-full overflow-hidden'>
      </div>
    </ClickSpark>
  );
}
export default App;
